//   ];

  const columns = ["cidade", "data", "casos", "mortes"];

//   useEffect(() => {
//       getListadata();
//   }, []);


    return (
    <div>
        <section>
        <List1>
          <h3>Graficos</h3>
        </List1>
        </section>
        {loading ? (
        <MUIDataTable 
        data = {cidades}
        columns={columns}
        // pagination={paginationFactory()}
        />) : (
            <Spinner color="primary" />
        )}
        
    </div>
    );
}

export default ListaDiaria;
